import { FETCH_USER, FAIL_FETCH_USER, REMOVE_USER, FAIL_REMOVE_USER } from 'store/actionTypes';
const initialState = {
    name: "",
    addedTime: "",
    lastActivity: "",
    resumeUrl: "",
    contactDetails: {
        email: "",
        phone: ""
    }
}
interface IContactDetails {
    email: string,
    phone: string
}
interface IState {
    name: string,
    addedTime: string,
    lastActivity: string,
    resumeUrl: string,
    contactDetails: IContactDetails
}

export const Employee = (state: IState = initialState, { type, payload }: any): any => {
    switch (type) {
        case FETCH_USER:
            return { ...payload }
        case FAIL_FETCH_USER:
            return { ...initialState }
        case REMOVE_USER:
            return { ...initialState }
        case FAIL_REMOVE_USER:
            return { ...initialState }
        default:
            return state
    }
}
